import { StatusBar } from "expo-status-bar";
import { StyleSheet, Text, View, Image } from "react-native";

export default function App() {
  return (
    <View style={styles.container}>
      <View style={styles.card}>
        <Image 
        source={require("./images/image-equilibrium.jpg")} 
        style={styles.nftImg}
        />
        <Text style={styles.title}>
        Equilibrium #3429
        </Text>
        <Text style={styles.description}>Our Equilibrium collection promotes balance and calm.</Text>
        <Text style={styles.eth}> 0.041 ETH</Text>
        <Text style={styles.durationTxt}>3 days left</Text>
        <View>
          <Image></Image>
          <Text style={styles.created}>Creation of Jules Wyvern</Text>
        </View>

      </View>
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "hsl(217, 54%, 11%)",
    alignItems: "center",
    justifyContent: "center",
  },
  card: {
    height: "50vh",
    width: "17vw",
    backgroundColor: "hsl(216, 50%, 16%)",
  },
  title: {
    color: "hsl(0, 0%, 100%)",
  },
  nftImg: {
    height: "20vh",
    width: "15vw",
  },
});
